import React, { Component } from 'react';
import { BrowserRouter, Switch, Route, withRouter } from 'react-router-dom';
import ScrollToTop from './ScrollToTop';
import Changelogs from './containers/Changelogs';
import Home from './containers/Home';
import JobGuide from './containers/JobGuide';

class AppRouter extends Component {
  render() {
    return (
      <BrowserRouter>
        <Switch>
          <ScrollToTop />
          <Route exact path='/' component={Home} />
          <Route exact path='/job-guide/:id' component={JobGuide} />
          <Route exact path='/change-logs' component={Changelogs} />

          {/* Personal Information */}
        </Switch>
      </BrowserRouter>
    );
  }
}

export default withRouter(ScrollToTop)(AppRouter);
